import{_ as p,a0 as e,a1 as a,a2 as t}from"./framework-a6f32df7.js";const c={},r=t('<h1 id="那下一次是什么时候呢" tabindex="-1"><a class="header-anchor" href="#那下一次是什么时候呢" aria-hidden="true">#</a> 那下一次是什么时候呢</h1><p>好久不见，我回来了，又是带着满身的不自信回来了</p><p>如此焦虑的等待</p><p>这算是孤注一掷吗？算是吧，去了绍兴，就真的没有机会了。</p><p>如何调整好我的心态，才是我目前需要做的，我现在已经提不起兴趣去好好静下心来看什么东西了</p><p>回想这一年，我刚到安硕报道的那一天，满怀着憧憬开始了我的职业生涯。我记得那天我带着大包小包坐上了高铁站，到了杭州东站之后又坐了很久的公交车，多久不记得了，只记得看了很久的风景。那时候看什么都是美好的，带着我的行李、带着我的希望，带着我的憧憬来到了杭州这一座我梦寐已久的城市。</p><p>下车的那一刻，这座城市似乎也不是我想象中的那样美好，我在满天沙尘中等待着同事带我去宿舍。</p><p>我还记得他帮我拎了行李，给了我钥匙之后又接着回去上班了。我看着脏兮兮的宿舍，一时间也不知道说什么。</p><p>我是需要和别人挤在同一个房间的，我简单的收拾了一下房间，把大沙发从房间里面搬出来腾出一块可以放我床的地方。接着我又废了好大的力气把折叠床搬进去，又花了很大力气把它展开。</p><p>我把一切都收拾好，我甚至没有自己的桌子的。第二天去上班的时候，我才真正的知道什么是外包。这让我大失所望，给我的工位甚至也是脏脏的，项目经理告诉我我们公司搞前端的人不是很多，基本上要自己学，我要是有什么不会的地方需要问另一位现在负责前端的同事。</p><p>真美好呀。当时有这么大的冲劲，心里想着自己好好学，然后抓紧离开外包，来捡回我的“尊严”。</p><p>可是事实就是，一切的一切，都需要我自己慢慢摸索，我不敢花钱去买课程，不敢随意的辞职，我很珍惜这一份来之不易的工作。</p><p>当时也是环境弄人吧，可以说是我学习劲头的巅峰时期。什么都不会，学什么东西都是这么有趣。</p><p>后来我慢慢的适应了这样的生活，渐渐的接受了自己“外包”的身份。</p><p>后来就是，大家随着项目的结束，慢慢的撤离了，就留下了我一个人，我也有自己的房间啦，也有自己的桌子啦。</p><p>再后来，项目总监告诉我不能给我提供实习岗位了。我心头一酸，瞬间脑子空白，不知道怎么办。幸运的是，我依旧可以打卡上班。</p><p>后面我就被通知要去苏州培训啦。</p><p>那天是和另外一位社招的同事一起做高铁去的。我们到了苏州坐了地铁、公交，依旧是一个非常漫长的过程。</p><p>我非常清楚的记得，我们那天到的时候已经是晚上了，非常的晚。保安不让我们进去，也怪我们没有问清楚具体的房号、密码什么的。于是那天晚上就坐在大马路上，一个一个的打电话找人帮忙，好在最后也是住了进去。房间里面摆着两张床，白白的床，没有被套的被子。</p><p>第二天去苏州公司报道，那一刻，我心里面，那才是我想要的办公环境，那才是正常的公司嘛。我竟然有了一点点归属感。。。可是我明白啊，我不属于这里，我最终是要离开的。</p><p>培训期间，我接触到了我向往的技术，那可能也是我在安硕唯一一次接触的机会了吧。</p><p>在后面，我作为三人当中最优秀的那一位，选择了跟着徐磊老师。这也是我来安硕这么久，唯一意义上的“老师”了吧，而且职位是这么的高，是苏州研发中心前端团队的负责人。我是多么的幸运呀。我以为我就此摆脱了“外包”的身份，内心激动万分。</p><p>后来得知，不是留在苏州跟着徐磊老师，而是跟着它继续去别的银行做项目。充满希望的心再一次跌落。</p><p>来到民泰的宿舍，我也是需要和别的同事挤一个房间的，我依旧没有自己的桌子，甚至这一次没有自己的衣柜，我熟练的把客厅角落的折叠床搬进房间，简单的收拾了一下。好在是夏天，我的行李不是很多，找了一张凳子简单的就收拾好了。</p><p>第二天报道的时候，楼下的保安还是说出来我最忌讳的词，“外包”。这两个字，在我这里，是多么的扎心，伤害是有多么的大。</p><p>项目是老项目，技术很老、框架很老，很多问题和棘手好在有徐磊老师。后面他就回去了，留下了我一个人来维护。可问题还是没有解决的，我很慌张，我害怕我做不好。</p><p>不过好在，问题还是解决了，他们还夸了我，带我和部门的领导一起吃了饭。我很不识趣，，没有和他们一起喝酒，徐磊老师叫我敬一杯我也无动于衷。。。。</p><p>后面就来到了温州银行啦，我连夜搬去了那边的宿舍。这一次，好大的一个房间是主卧，有自己柜子，有自己的桌子，还有自己一个人的房间。我非常的开心，就是床上是空荡荡的，只有一块木板，但是已经很好了。</p><p>温州银行是我经历过的，最好的地方。有自己的食堂，它那里的食堂是真的好诶。有免费的粥、豆浆、汤什么的，而且价格也不是很贵。</p><p>后面我就顺利的完成了开发任务啦~</p><p>大概是十二月份的时候就已经没有什么事情做了，项目经历当时还很打趣的说到，贝哥走了以后我就是这里的“前端负责人”了。</p><p>再后来就是到了现在咯，一直到今年的二月份我才决定开始投简历，一直到三月二号收到了面试题，后面就是有了面试的邀请，再就是等待结果。。。</p><p>在我看来，这是我唯一的一次机会，是的，绝无仅有的一次机会。这一次失败，我将要开始正式的九九六生活，我将没有空余时间参加、准备面试，需要等我离开那个地方。</p><p>尽管这些都还没有发生，但是我想说的是，我回顾我的工作经历，不都是慢慢的一点点变好的吗？</p><p>或许，我不能如愿，但是我相信，一切发生的事情，皆有利与我。也不必太担心这一次面试失败了会怎么怎么样，我最起码还有一份工作，我最起码还有收入，最差的结果也就是九九六嘛。</p><p>我也有想过我要不要离职，简单的权衡了一下，我认为我不能失去这一份工作，我不能没有收入来源的。我已经失去了婷婷，我不能再失去工作。</p><p>好好的平复一下我的心情吧，准备好进入下一段工作的心态。慢慢积累嘛，我也不用觉得不公平什么的，我本来就没有有多努力呀，这一切都是对我来说最好的安排了。一切都会变好的，一切都会如我所愿的，一切都是最好的安排。</p><p>还没有发生的不确定的事情，就不要再去做过多的纠结了，该发生的事情，自然会发生的。</p><p>继续积累吧~~总有一天你会如愿的哦</p>',39),_=[r];function n(o,s){return e(),a("div",null,_)}const i=p(c,[["render",n],["__file","2.html.vue"]]);export{i as default};
